&quot;Hotel California&quot;
&quot;Tequila Sunrise&quot;
&quot;Help Me Through the Night&quot;
&quot;The Heart of the Matter&quot;
&quot;Love Will Keep Us Alive&quot;
&quot;Learn to be Still&quot;
&quot;Pretty Maids All on a Row&quot;
&quot;The Girl from Yesterday&quot;
&quot;Wasted Time&quot;
&quot;I Can't Tell You Why&quot;
&quot;New York Minute&quot;
&quot;The Last Resort&quot;
&quot;Take it Easy&quot;
&quot;Life in the Fast Lane&quot;
&quot;In the City&quot;
&quot;Get Over It&quot; 
And a DTS only track Seven Bridges Road.
